import Note from "./Note"
import CreateNote from "./CreateNote";

function App() {
    let allNotes = []
    const [notes, setNotes] = useState({})

    function handleCreate(fullNote) {
        setNotes(fullNote)
        allNotes.push(fullNote)
        console.log(allNotes)
    }

    return (
        <div>
            <h1>Hello world</h1>
            <CreateNote onAdd={handleCreate}/>
        </div>
    )
}

export default App;
